import React from 'react';

const Form = (props) => {
    return (
        <div className="form">
            <input value={props.inputValue} onChange={(event) => props.inputOnChange(event)} type="text" />
            <button onClick={() => props.buttonOnClick}>
                <span>Add</span>
            </button>
      </div>
    );
};

export default Form;
